  render() {
    return (
      <div>
        <h1>Home</h1>
        <h3 style = {{paddingTop: '5px'}}>Who are we?</h3>
        <h5>We are a supplement store that sell vitamins and nutrient capsules for people to take!</h5>
        <h5 style = {{paddingBottom: '50px'}}>Are you ready to check out our store? Press the button below to start!</h5>
        <Link to="/list" className="btn btn-primary">View List</Link>
      </div>
    )
  }
}
